import Home from './pages/home'
import Menu from './components/menu'
import { Routes, Route, BrowserRouter } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css'


function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Home/>}></Route>             
            </Routes>
        </BrowserRouter>
    );
}

export default App;
